description:
Variation of condition 15 (in accordance with approved drawings) pursuant to planning permission dated 18/10/2012 ref 2012/1258 (Demolition of all existing buildings. Erection of five buildings of 4-12, 4-8, 7, 5-7 and 4-6 storeys to provide 527 residential units (135 x 1 bed, 261 x 2 bed,105 x 3 bed and 26 x 4 bed), with approx. 7800 square metres of private, communal and public space and public routes. Car parking (121 spaces within basement and 15 spaces at grade), 687 cycle parking spaces plus approximately 530 square metres of community space in the centre of the site and approximately 569 square metres of commercial space (classes A1-A5 (retail, financial and professional services, cafe/restaurant, take away, pub/bar and/or B1 office use) at the northern end of the site. Vehicular accesses from Comyn Road and Eckstein Road and emergency access from St John's Hill and Strath Terrace.) to allow:
Plot 2: two storey increase allowing an additional 23 flats and change in tenure to older persons social rent only, removal of basement carparking;
Plot 3: two story increase to the centre tower allowing an additional 11 flats and change in tenure to private rent only;
Plot 6: one storey increase allowing three additional flats;
Plot 7: four additional flats (through internal reconfigurations);
Plot 8: loss of one flat;
Plot 9: One storey increase to the western section, extension of southern section facing Comyn Road to close the building gap and removal of corner feature to Comyn Road to allow 31 additional flats, inclusion of parking below podium level;
General alterations to fenestration and finishes to accommodate changes and reconfiguration of carparking resulting in a loss of 28 spaces. Overall reconfiguration results in 599 residential units across the site.
